/* fonts */
export const FontFamily = {
  outfitBold: "Outfit_bold",
  nunitoRegular: "Nunito_regular",
  interRegular: "Inter_regular",
  outfitMedium: "Outfit_medium",
};
/* font sizes */
export const FontSize = {
  size_5xl: 24,
  size_sm: 14,
  size_xs: 12,
  size_base: 16,
};
/* Colors */
export const Color = {
  white: "#fff",
  gray: "#222227",
  paleturquoise_100: "#c6f8fe",
  paleturquoise_200: "#a6f2fc",
  paleturquoise_300: "rgba(166, 242, 252, 0.8)",
  black: "#000",
  dimgray: "#635c5c",
};
/* border radiuses */
export const Border = {
  br_8xs: 5,
  br_3xs: 10,
};
